import React, { Component } from "react";
import Car from "../car/";
import './carList.css';
import localCache from "./localCache";
let request = require("superagent");

export default class CarList extends Component {
    componentDidMount() {
        request.get("http://localhost:3001/cars").end((error, res) => {
            if (res) {
                let cars = JSON.parse(res.text);
                localCache.populate(cars);
                this.ListeningStateChangedEvent({});
            } else {
                console.log(error);
            }
        });
    }


    render() {
        let updatedCarsList = localCache.getAll();
        const carCards = this.updatedCarsList.map(c => (
            <Car key={c.owner} car={c} />
        ));
        return (
            <div className="container-fluid cars bg-info">
                <div className="row">{carCards}</div>
            </div>
        );
    }
}
